import React from "react";

function HomePage() {
  return (
    <React.Fragment>
      <div
        style={{
          backgroundImage:
            "url(https://img.glyphs.co/img?src=aHR0cHM6Ly9zMy5tZWRpYWxvb3QuY29tL3Jlc291cmNlcy9MaWdodC1QYXN0ZWwtQmx1cnJlZC1CYWNrZ3JvdW5kcy04MDB4NTE4LTEuanBn&q=90&enlarge=true&h=1036&w=1600)",
          height: "100vh",
        }}
      >
        {/* <img
          src="images/LandingImage.png"
          alt="Medic"
          style={{ height: "100vh", width: "100%" }}
        ></img> */}
        <img
          src="https://i.pinimg.com/originals/2c/ea/fb/2ceafb64a5dae55d2a61ef5e12be6e5f.gif"
          alt="loading..."
          style={{ height: "40vh", paddingTop: "100px" }}
        />
        <img
          src="https://thumbs.gfycat.com/EntireLonelyIvorygull-max-1mb.gif"
          alt="loading..."
          style={{ height: "40vh", paddingTop: "100px" }}
        />
        <img
          src="https://64.media.tumblr.com/54be4d6267b4ad8a9b247f9bf3b9f315/tumblr_nwo1my14WT1ujkobfo1_500.gifv"
          alt="loading..."
          style={{ height: "40vh", paddingTop: "100px" }}
        />
        <img
          src="https://media4.giphy.com/media/H3XtVVJYqAIKmXJNd2/source.gif"
          alt="loading..."
          style={{ height: "40vh", paddingTop: "100px" }}
        />
        <img
          src="https://projekte.sueddeutsche.de/implantfiles/politik/implant-files-english-version-the-sick-system-e167322/_article_header_iconw210q70-015d748108507957.gif"
          alt="loading..."
          style={{ height: "40vh", paddingTop: "50px" }}
        />
        <img
          src="https://thumbs.gfycat.com/CoolParchedIbis-max-1mb.gif"
          alt="loading..."
          style={{ height: "40vh", paddingTop: "50px" }}
        />
        <img
          src="https://gifimage.net/wp-content/uploads/2017/10/doctores-gif-1.gif"
          alt="loading..."
          style={{ height: "40vh", paddingTop: "50px" }}
        />
        <img
          src="https://media1.giphy.com/media/euQclEM3oFy07Pma0l/giphy.gif"
          alt="loading..."
          style={{ height: "40vh", paddingTop: "50px" }}
        />
      </div>
    </React.Fragment>
  );
}

export default HomePage;
